import React, { useState, useEffect } from 'react'; // import specific statements
import { Container, Card, CardContent, Typography, Button } from '@mui/material';
import axios from 'axios';


const ProductList = () => {
  const [products, setProducts] = useState([]); // define the state for storing products

  //implement the get products function
  const fetchProducts = async () => {
    try {
      const apiBaseUrl = process.env.REACT_APP_API_BASE_URL;
      const response = await axios.get(`${apiBaseUrl}/api/products`);
      console.log(response.data);
      setProducts(response.data);
    } catch (error) {
      console.error('Error fetching products:', error);
    }
  };

  //implement the delete function
  const handleDelete = async (id) => {
    try {
      const apiBaseUrl = process.env.REACT_APP_API_BASE_URL;
      await axios.delete(`http://localhost:3000/api/products/${id}`);
      setProducts(currentProducts => currentProducts.filter(product => product.id !== id));
    } catch (error) {
      console.error('Failed to delete product:', error);
    }
  };

  useEffect(() => {
    fetchProducts();
  }, []);

  return (
    <Container>
    {products.length > 0 ? (
      products.map(product => (
        <Card key={product.id} style={{ margin: '20px' }}>
          <CardContent>
            <Typography variant="h5">{product.name}</Typography>
            <Typography color="textSecondary">{product.description}</Typography>
            <Typography color="textSecondary">${product.price}</Typography>
            <Button color="secondary" onClick={() => handleDelete(product.id)}>
              Delete
            </Button>
          </CardContent>
        </Card>
      ))
    ) : (
      <Typography>No products found</Typography>
    )}
  </Container>
  );
};

export default ProductList;
